 &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{"days":[1,8,15,22]},"id":"1531","type":"DaysTicker"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{"months":[0,6]},"id":"1536","type":"MonthsTicker"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1105","type":"Quad"},{"attributes":{},"id":"1017","type":"BasicTicker"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1534","type":"MonthsTicker"},{"attributes":{},"id":"1452","type":"AllLabels"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1012"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1015","type":"Grid"},{"attributes":{"axis":{"id":"1088"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1091","type":"Grid"},{"attributes":{"axis":{"id":"1226"},"coordinates":null,"group":null,"ticker":null},"id":"1229","type":"Grid"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_alpha":{"value":0.1},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1151"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1172","type":"Rect"},{"attributes":{},"id":"1319","type":"AllLabels"},{"attributes":{},"id":"1288","type":"LinearScale
